webpackJsonp([27273817056835],{5642:function(e,t){e.exports={data:{post:{html:'<p>CNN.com on the mid-air collision over Lake Constance: <a href="http://europe.cnn.com/2002/WORLD/europe/07/08/germany.crash/index.html">Pilot got conflicting warnings</a>. It seems there were a lot a problems at the privatized Swiss air traffic control <a href="http://www.skyguide.ch">Skyquide</a> that night. Phone lines down, collision control shut down for maintenance, back-up controller on break. The automatic on-board system worked. The human controller gave conflicting instructions. And the pilot had just seconds to decide what to do.</p>',fields:{title:"Seconds To Decide",date:"08 Jul 2002",url:"https://papascott.de/2002-07-08-seconds-to-decide/"}}},pathContext:{slug:"/2002-07-08-seconds-to-decide/",prev:{fields:{title:"Mandrake On The Notebook",date:"08 Jul 2002",slug:"/2002-07-08-mandrake-on-the-notebook/"}},next:{fields:{title:"30 Ways To Leave Your Lover",date:"09 Jul 2002",slug:"/2002-07-09-30-ways-to-leave-your-lover/"}}}}}});
